def hex2raw(hex_string):
    chunk_size = 2
    raw_data = binascii.unhexlify(''.join(hex_string[i:i+chunk_size] for i in range(0, len(hex_string), chunk_size)))
    return raw_data

def write2dump(file,data):
    f=open(file,"wb")
    for x in data: f.write(x)
    f.close()

